import React from 'react';
import Navigation from '../../components/Navigation/Navigation';
import './Home.css';

const Home = (props) => {
  const route = props.location.pathname;

  if(route === "/Signup") {
    return (
      <div className="homepage">
        <Navigation />
        <div className="authcontainer">
          <span>Create an account</span>
          <span className="authcontainer-section">Email</span>
          <input />
          <span className="authcontainer-section">Username</span>
          <input />
          <span className="authcontainer-section">Password</span>
          <input />
        </div>
      </div>
    );
  } else if(route === "/Login") {
    return (
      <div className="homepage">
        <Navigation />
      </div>
    );
  } else if(route === "/") {
    return (
      <div className="homepage">
        <Navigation />
      </div>
    );
  }
};

export default Home;
